==錯誤轉換修正==
-{
*被发卡=>被發卡//「发卡=>髮卡」的修正;
*发卡=>髮卡;
*是人干的=>是人幹的;
*与神桔世=>与神桔世; //与神為姓氏;
*之后干了个爽=>之后幹了個爽; // 这个短语应该是：干→乾（×），干→幹（√）
*须须木=>須須木; //須須木為姓氏;
*饭田里穗=>飯田里穗;
*手游=>手遊; //[[special:diff/713703]]
*希特拉=>希特拉;
*希特勒=>希特勒;
*钢之炼金术师=>鋼之鍊金術師;
*钢炼=>鋼鍊; // 否则将会误转换为“-{鋼煉}-”
*钢链手指=>鋼鍊手指;
}-

